import data from "../json/painting.json";
import { Counter } from "./Counter";
import { Card } from "./Card";
import { Section } from "./Section";
import { PageTitle } from "./Calendar/PageTitle";

export const App = () => {
  return (
    <div>
      <Section title="Top Week" styles={{ textAlign: "center" }}>
        <Card data={data} />
        <Counter />
      </Section>

      <PageTitle title="" />
    </div>
  );
};
